import { BrowserRouter, Routes, Route} from "react-router-dom";
import AllMeetUpsPage from "./pages/AllMeetUps";
import NewMeetUpPage from "./pages/NewMeetUps";
import Favourites2 from "./pages/Favorites2";

function App() {
  return (
      <div>
        <BrowserRouter>
          <Routes>
            <Route path='/'>
              <AllMeetUpsPage />
            </Route>
            <Route path='/new'>
              <NewMeetUpPage />
            </Route>
            <Route path='/fav'>
              <Favourites2 />
            </Route>
          </Routes>
        </BrowserRouter>


  </div>
  );
}

export default App;
